	add("veneer", "{\"term\":\"veneer\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"French\", \"frankish\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"old high german (ca. 750-1050)\"], \"text\":\"From German {{m|de|Furnier}}, from \u0027furnieren\u0027 (to inlay, cover with a veneer) from French \u0027fournir\u0027 (to furnish, accomplish) from Middle french (ca. 1400-1600) {{m|frm|fornir}}, from Old french (842-ca. 1400) {{m|fro|fornir}}, \u0027furnir\u0027 (to furnish) from Old Frankish *\u0027\u0027 (frumjan) from Proto-germanic {{m|gem-pro|*frumjaną||to further, promote}}. Cognate with Old high german (ca. 750-1050) {{m|goh|frumjan}}, \u0027frummen\u0027 (to accomplish, execute, provide) Old english (ca. 450-1100) \u0027fremian\u0027 (to promote, perform) More at {{l|en|furnish}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A thin decorative covering of fine material (usually wood) applied to coarser wood or other material\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003dForeword|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dA very neat old woman, still in her good outdoor coat and best beehive hat, was sitting at a polished mahogany table on whose surface there were several scored scratches so deep that a triangular piece of the \u0027\u0027veneer\u0027\u0027 had come cleanly away,\u0026amp;nbsp;[\u0026amp;hellip\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An attractive appearance that covers or disguises true nature or feelings\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027 December 5, \u0026quot;[http://www.nytimes.com/interactive/2014/12/07/magazine/100000003269167.mobile.html?_r\u003d1 Joy From the World],\u0026quot; \u0027The New York Times Magazine\u0027 \u0026lt;small\u0026gt;(retrieved 6 December 2014)\u0026lt;/small\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"“Yalda,” Dabashi says, “has managed to survive the centuries because it has been gently recodified with a Muslim \u0027\u0027veneer\u0027\u0027.”\", \"priority\":5}]}, \"synonyms\":{}}");

