	add("vengeance", "{\"term\":\"vengeance\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From Anglo-norman {{m|fro|vengeaunce}}, from Old french (842-ca. 1400) {{m|fro|vengeance}}, {{m|fro|venjance}}, from \u0027vengier\u0027 (to avenge)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Revenge taken for an insult, injury, or other wrong\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, \u0027\u0027 (film\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"My name is Maximus Decimus Meridius, commander of the Armies of the North; General of the Felix Legions; loyal servant to the true emperor, Marcus Aurelius; father to a murdered son; husband to a murdered wife; and I will have my \u0027\u0027vengeance\u0027\u0027, in this life or the next\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Desire for revenge\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Thereupon full of anger, full of jealousy, full of \u0027\u0027vengeance\u0027\u0027, she forms a scheme of retribution\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Jean Harvey Baker, \u0027Mary Todd Lincoln: A Biography\u0027 (ISBN 0393075680\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"If her husband was all forgiveness, asking the bands to play “Dixie,” she was full of \u0027\u0027vengeance\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, James Calloway, \u0027Black America, Not in This America\u0027 (ISBN 1462868576\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Are they full of \u0027\u0027vengeance\u0027\u0027[?], because they say that people with \u0027\u0027vengeance\u0027\u0027 in their hearts must dig two graves, one for their enemy and the other for themselves\", \"priority\":9}]}, \"synonyms\":{}}");

