	add("venice", "{\"term\":\"venice\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\", \"Latin\", \"illyrian\"], \"text\":\"From Italian from \u0027venetia\u0027 from Latin \u0027veneti\u0027 an ancient (possibly Illyrian tribe.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A maritime city and associated province in the Veneto, Italy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Graham Holderness, \u0027Shakespeare and Venice\u0027 (ISBN 0754666069), page 141\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"As I indicated at the outset, for us Shakespeare\u0027s Venetian plays lie between the early modern republic described in Chapter 2, and all the subsequent \u0027\u0027Venices\u0027\u0027 of our experience, education and imagination\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The historical maritime empire of Venice\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A neighborhood of Los Angeles, California\", \"priority\":5}]}, \"synonyms\":{}}");

