	add("venom", "{\"term\":\"venom\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman from Old french (842-ca. 1400) \u0027venim\u0027 from {{m|la|*venimem}}, from Latin \u0027venenum\u0027 from Proto-indo-european {{m|ine-pro|*wenes-no-||lust, desire}}, see also Sanskrit \u0027वनति\u0027 (gain, wish, erotic lust) and Latin \u0027venus\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A poison carried by an animal, usually injected into an enemy or prey by biting or stinging; atter\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Hurtful worm with cankered \u0027\u0027venom\u0027\u0027 bites\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Feeling or speech marked by spite or malice\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027venom\u0027\u0027 of such looks\", \"priority\":6}]}, \"synonyms\":{}}");

	add("venography", "{\"term\":\"venography\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|veno|graphy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A diagnostic procedure in which an X-ray of the veins, a venogram, is taken after a special dye is injected into the bone marrow or veins\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ventilation", "{\"term\":\"ventilation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027ventilation\u0027 from Old french (842-ca. 1400) \u0027ventilacion\u0027 from \u0027ventilatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The replacement of stale or noxious air with fresh\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027, w:Robert Robert DeNiro (actor), \u0027w:Backdraft Backdraft\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"So you punched out a window for \u0027\u0027ventilation\u0027\u0027. Was that \u0027before\u0027 or \u0027after\u0027 you noticed you were standing in a lake of gasoline\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The mechanical system used to circulate and replace air\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An exchange of views during a discussion\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The bodily process of breathing; the inhalation of air to provide oxygen, and the exhalation of spent air to remove carbon dioxide\", \"priority\":6}]}, \"synonyms\":{}}");

	add("ventresca", "{\"term\":\"ventresca\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Flesh from the belly of a tuna, which is prepared in oil and served as food\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Elizabeth David, \u0027Italian Food\u0027, Penguin Classics (1999), ISBN 978-0-14-118155-4, [http://books.google.com/books?id\u003dW63eu2qfEUIC\u0026amp;pg\u003dPA13\u0026amp;dq\u003dventresca page 13\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The choice part of the tunny fish is the stomach (\u0027\u0027\u0027ventresca\u0027\u0027\u0027), which is very tender and of an appetizing creamy-pink color. For a salad one must always ask for \u0027\u0027\u0027ventresca\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Gillian Riley, \u0027The Oxford Companion to Italian Food\u0027, Oxford University Press, ISBN 978-0-19-860617-8, [http://books.google.com/books?id\u003d-HStec87HdcC\u0026amp;pg\u003dPT190\u0026amp;dq\u003dventresca page 163\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Anatra ripiena\u0027 is a Venetian recipe for duck, sometimes boned, stuffed with a rich mixture of breadcrumbs , sometimes some tunny \u0027\u0027\u0027ventresca\u0027\u0027\u0027, and nutmeg\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Marcella Hazan, “Eating Alone”, in Jenni Ferrari-Adler (editor), \u0027Alone in the Kitchen with an Eggplant\u0027, Riverhead Books, ISBN 978-1-59448-947-1, [http://books.google.com/books?id\u003du_nini5DX5sC\u0026amp;pg\u003dPA104\u0026amp;dq\u003dventresca page 104\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Ventresca\u0027\u0027\u0027, tuna’s succulent belly, is another of my favorites. If I have some cooked cannellini or \u0027borlotti\u0027 beans in the refrigerator, I warm them up with some of the liquid they have been cooked in, then drain them and add them to a can of \u0027\u0027\u0027ventresca\u0027\u0027\u0027 together with several thin slices of raw onion\", \"priority\":7}]}, \"synonyms\":{}}");

	add("ventricle", "{\"term\":\"ventricle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027ventricule\u0027 from Latin \u0027ventriculus\u0027 (belly, stomach, ventricle) diminutive of \u0027venter\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any small cavity within a body; a hollow part or organ, especially\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One of two lower chambers of the heart.\u0026lt;!--Encyclopedic info: In higher vertebrates, the left ventricle receives arterial blood from the left atrium and pumps it into the aorta, and the right ventricle receives venous blood from the right atrium and pumps it into the pulmonary artery.--\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One of four cavities in the brain\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The stomach\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1662\u0027\u0027, w:Henry Henry More, \u0027s:An Antidote Against An Antidote Against Atheism\u0027, Book II, A Collection of Several Philosophical Writings of Dr. Henry More, p. 72\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"On birds] \u0026quot;Where omitting the more general Properties, of having two \u0027\u0027Ventricles\u0027\u0027, and picking up stones to conveigh them into their second Ventricle, the Gizzern, (which provision and instinct is a supply for the want of teeth;) \u0026quot\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The womb\", \"priority\":7}]}, \"synonyms\":{}}");

	add("ventriculography", "{\"term\":\"ventriculography\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Imaging of ventricles, usually in the heart\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ventrilocution", "{\"term\":\"ventrilocution\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1798\u0027\u0027, w:Charles Brockden Charles Brockden Brown, \u0027Wieland, or the Transformation: An American Tale\u0027, chapter 22\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"quot;You are not apprized of the existence of a power which I possess. I know not by what name to call it. [* Biloquium, or \u0027\u0027ventrilocution\u0027\u0027. Sound is varied according to the variations of direction and distance. . . .] It enables me to mimic exactly the voice of another, and to modify the sound so that it shall appear to come from what quarter, and be uttered at what distance I please.\u0026quot\", \"priority\":2}]}, \"synonyms\":{}}");

	add("ventriloquist", "{\"term\":\"ventriloquist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027ventriloquy\u0027 + \u0027-ist\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person, especially an entertainer, who practices ventriloquism\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1871\u0027\u0027, Plato, translated by w:Benjamin Benjamin Jowett, The Sophist\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Most ridiculous is the discomfiture which attends the opponents of predication, who, like the \u0027\u0027ventriloquist\u0027\u0027 Eurycles, have the voice that answers them in their own breast\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1900\u0027\u0027, w:L. Frank L. Frank Baum, \u0027The Wonderful Wizard of Oz\u0027, s:The Wonderful Wizard of Oz/Chapter Chapter 15\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;Oh, I am a \u0027\u0027ventriloquist\u0027\u0027,\u0026quot; said the little man. \u0026quot;I can throw the sound of my voice wherever I wish, so that you thought it was coming out of the Head. \u0026quot\", \"priority\":5}]}, \"synonyms\":{}}");

	add("venture", "{\"term\":\"venture\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Shortening of \u0027adventure\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A risky or daring undertaking or journey\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1881\u0027\u0027, Robert Louis Stevenson, \u0027Treasure Island\u0027. Chapter 4\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"My heart was beating finely when we two set forth in the cold night upon this dangerous \u0027\u0027venture\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An event that is not, or cannot be, foreseen; an accident; chance; contingency\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The thing risked; a stake; especially, something sent to sea in trade\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"My \u0027\u0027ventures\u0027\u0027 are not in one bottom trusted\", \"priority\":7}]}, \"synonyms\":{}}");

